import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import PostComponent from './PostComponent'; // Make sure the path is correct
import './Forum.css';

const Section = ({ title, children }) => {
  return (
    <section>
      <h2>{title}</h2>
      {children}
    </section>
  );
};

function Forum() {
  const [posts, setPosts] = useState([]);
  const [selectedPost, setSelectedPost] = useState(null);
  const [selectedRecommendation, setSelectedRecommendation] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    axios.get('http://localhost:3001/forum/posts')
      .then(response => {
        setPosts(response.data);
      })
      .catch(error => console.error('Error fetching posts:', error));
  }, []);

  const goToPost = (postId) => {
    const post = posts.find(p => p._id === postId);
    setSelectedPost(post);
    setSelectedRecommendation(null); // Clear selected recommendation when a new post is selected
  };

  const handleRecommendationClick = (postId) => {
    setSelectedRecommendation(postId);
    fetchRecommendationData(postId); // Fetch recommendation data when clicked
  };

  const fetchRecommendationData = (postId) => {
    // Make an axios request to fetch recommendation data based on the postId
    axios.get(`http://localhost:3001/forum/recommendations/${postId}`)
      .then(response => {
        setSelectedPost(response.data); // Set the selected post to the recommendation data
      })
      .catch(error => console.error('Error fetching recommendation data:', error));
  };

  const handleprofile = () => {
    navigate('/share');
  };

  return (
    <div className="Forum">
      <Section className="Forums">
        <div className="forum-content">
          {/* your background image */}
        </div>
      </Section>

      {selectedPost ? (
        <PostComponent post={selectedPost} />
      ) : (
        <Section title='Forum Posts'>
          <div className="posts-list">
            {posts.map((post) => (
              <div key={post._id} onClick={() => goToPost(post._id)} className="post">
                <h3 className="post-title">{post.title}</h3>
                <p className="post-details">
                  <span className="post-author">{post.author}</span> |{' '}
                  <time className="post-date">{new Date(post.createdAt).toLocaleDateString()}</time>
                </p>
              </div>
            ))}
          </div>
        </Section>
      )}

      {selectedRecommendation && (
        <Section title="Recommendations for you">
          <div className="image-text-container">
            {selectedRecommendation.map((recommendation) => (
              <div
                key={recommendation._id}
                onClick={() => handleRecommendationClick(recommendation._id)}
                className="recommendation"
              >
                <img
                  src={recommendation.image} // Load images dynamically from recommendation data
                  alt={`Recommended Image`}
                  className="image"
                />
                <div className="text">{recommendation.title}</div>
              </div>
            ))}
          </div>
        </Section>
      )}

      <Section title="Random Recommendation">
        <div className="random-recommendation">
          {/* Render the random recommendation component */}
        </div>
      </Section>

      <Section>
        <div className="story-share">
          <h1 className='story-text1'>Share your story</h1>
          <p className='story-text2'>
            Do you want to keep track of your journey? Or do you prefer to connect with others who are also new in Finland? Please share your story and experiences here!
          </p>
          <button className="share-story-button" onClick={handleprofile}>
            Click here
          </button>
        </div>
      </Section>
    </div>
  );
}

export default Forum;
